import './App.css';
import { FaTimes} from 'react-icons/fa';

function Todo({todo, onDelete, onCompleted}) {  
  return (
  	<div>
      <div 
      className={`Todo ${todo.completed ? 'Completed' : ''}`} 
      onClick={() => onCompleted(todo.id)}>
          <p>{todo.id}. {todo.title} 

          </p>
      </div>

      <FaTimes onClick={() => onDelete(todo.id)} style={{float: 'right', margin: '20px'}}/>
      </div>
  );
}

export default Todo;
